import React from 'react';
import Member from './members/Member';

function Teammember() {

    const info = [
        {img : 'images\\img_avatar-01.png', name : 'Hesham', title : 'Front-end', mail : 'hesham@gmail.com', phone : '01119554463'},
        {img : 'images\\img_avatar-01.png', name : 'Abeer', title : 'Teacher', mail : 'abeer@gmail.com'},
        {img : 'images\\img_avatar-01.png', name : 'Aseel', title : 'Baby', mail : 'aseel@gmail.com'},
        {img : 'images\\img_avatar-01.png', name : 'Haytham', title : 'Engineer', mail : 'haytham@gmail.com'}
    ]

    const changeNames = () =>{
        return [
            {img : 'images\\img_avatar-01.png', name : 'changed', title : 'Front-end', mail : 'hesham@gmail.com', phone : '01119554463'},
            {img : 'images\\img_avatar-01.png', name : 'changed', title : 'Teacher', mail : 'abeer@gmail.com'},
            {img : 'images\\img_avatar-01.png', name : 'changed', title : 'Baby', mail : 'aseel@gmail.com'},
            {img : 'images\\img_avatar-01.png', name : 'changed', title : 'Engineer', mail : 'haytham@gmail.com'}
        ];
    }

  return (
      <div className='container'>
            <div className='navbar bg-dark text-white shadow-lg p-3 mb-5'>
                <h1>Our Member</h1>
            </div>
            <div className='row'>
                <Member {...info[0]} />
                <Member {...info[1]} />
                <Member {...info[2]} />
                <Member {...info[3]} />
                <button className='btn btn-primary' style={{margin: '10px auto'}} onClick={() => changeNames}>change names</button>
            </div>
      </div>
  )
}

export default Teammember;
